(function(){angular.module("animateApp").controller("socialLoginCtrl",["$scope","$auth",function(a,b){a.fb_button=!0;a.google_button=!0;a.logout_button=!1;a.authenticate=function(c){b.authenticate(c).then(function(b){"undefined"!=typeof b.data.token?(a.fb_button=!1,a.google_button=!1,a.logout_button=!0):alert(c+" Login error")},function(a){alert(c+" Login error")})};a.logOut=function(){b.logout();a.fb_button=!0;a.google_button=!0;a.logout_button=!1}}])})();